import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
// import {Card} from "react-bootstrap";
import "./main.css";



function clickMe(){
  console.log ('you clicked me ');
}



class  Main extends React.Component {
    

    render() {
      return (
        <div className='main'>  
            <div className='main-container'> 
              <div className='main-body'>
                <h1 className='main-title'>
                  Speactivity  Up Your Language Activities
                </h1>
                  <div className='main-divtext'>
                    <p className='main-text'>
                     Welcome to  Speactivity! Here, people team up and make activites to learn a language together as a community.
                     People can meet toether to take an online quiz and meet in real live event
                    </p>
                  </div>
                  <div className="main-divbutton">
                    <button onClick={clickMe} className='register-button'>Click to register</button>
                  </div>
              </div>
            </div>
        </div>
    );
  }
  }
  
  export default Main;
